				LEFT OUTER JOIN ospos_employees AS ep
					ON ep.person_id = sl.employee_id 
				WHERE DATE(sl.ledger_time) BETWEEN '2023-10-25' AND '2023-10-25' and  sl.supplier_id = 5
				GROUP BY ledger_id, ledger_time
