					case when SUM(ROUND(sl.credit_amount, 2)) > SUM(ROUND(sl.debit_amount, 2)) then SUM(ROUND(sl.credit_amount, 2))-SUM(ROUND(sl.debit_amount, 2)) else 0 end AS credit_amount,
